import React from "react";

const FilterMenu = ({ items }) => {
  return (
    <ul className="list-group">
      {items.map((item, ind) => {
        return (
          <li className="list-group-item list-group-item-action disabled">
            {item}
          </li>
        );
      })}
    </ul>
  );
};

export default FilterMenu;
